package com.xinput.wechatpay.result;/** * 代金券 */public class UnifiedCoupon {    private Integer index;    private String coupon_id;    private String coupon_type;    private Integer coupon_fee;    public String getCoupon_id() {        return coupon_id;    }    public Integer getIndex() {        return index;    }    public void setIndex(Integer index) {        this.index = index;    }    public void setCoupon_id(String coupon_id) {        this.coupon_id = coupon_id;    }    public String getCoupon_type() {        return coupon_type;    }    public void setCoupon_type(String coupon_type) {        this.coupon_type = coupon_type;    }    public Integer getCoupon_fee() {        return coupon_fee;    }    public void setCoupon_fee(Integer coupon_fee) {        this.coupon_fee = coupon_fee;    }}